INSERT INTO `core_privacy_policy` (`id`, `content`) VALUES
('privacy1', '&lt;p&gt;&lt;strong&gt;Privacy Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This Privacy Policy outlines how our restaurant app collects, uses, and protects the personal information of our users. We are committed to protecting your privacy and ensuring that your personal information is secure. By using our app, you consent to the collection and use of your personal information as described in this policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Collection of Personal Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We collect personal information from you when you use our app, such as when you make a reservation, place an order, or sign up for our loyalty program. The personal information we collect may include your name, email address, phone number, and payment information.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Use of Personal Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We use your personal information to provide you with our restaurant services, including making reservations, processing orders, and providing loyalty rewards. We may also use your personal information to send you marketing communications and to improve our app and services.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sharing of Personal Information&lt;/p&gt;\r\n\r\n&lt;p&gt;We do not share your personal information with third parties, except as necessary to provide our restaurant services or as required by law. We may share your personal information with our service providers, such as payment processors and marketing agencies, to assist us in providing our services.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Security of Personal Information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We take reasonable steps to protect your personal information from unauthorized access, use, or disclosure. We use industry-standard security measures, such as encryption and firewalls, to protect your personal information. However, no method of transmission over the internet or electronic storage is completely secure, so we cannot guarantee the absolute security of your personal information.&lt;/p&gt;\r\n\r\n&lt;p&gt;Accessing and Updating Personal Information&lt;/p&gt;\r\n\r\n&lt;p&gt;You can access and update your personal information by logging into your account in our app. If you have any questions about your personal information or want to delete your account, please contact us at [insert contact information].&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Changes to Privacy Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We may update this Privacy Policy from time to time. We will notify you of any material changes to this policy by posting the updated policy on our app or by sending you an email notification. Your continued use of our app after any changes to this policy will constitute your acceptance of the updated policy.&lt;/p&gt;');
