INSERT INTO `rt_feeds` (`id`, `name`, `description`, `added_date`, `added_user_id`, `updated_date`, `updated_user_id`, `status`) VALUES
('feed172a9a3ed8ea084b87c5be8f384893ba', 'Mix Veg Masala Promotion', 'Introducing our delicious Mix Vegetable Masala - a vegetarian dish that will tantalize your taste buds with its aromatic blend of spices and colorful array of fresh vegetables.\r\n\r\nWe start by sautéing a variety of hand-picked vegetables such as potatoes, carrots, peas, green beans, cauliflower, and bell peppers to create the perfect texture and flavor. These veggies are then simmered in a rich and tangy tomato-based gravy that\'s infused with a blend of exotic spices like cumin, coriander, turmeric, and garam masala.\r\n\r\nOur Mix Vegetable Masala is made with the freshest and highest quality ingredients that are sourced locally. It\'s not only a great source of essential nutrients but also a feast for the senses.\r\n\r\nThis wholesome and flavorful dish is perfect for vegetarians and vegans and pairs perfectly with naan bread, rice, or roti. Whether you\'re looking for a comforting meal or want to explore the richness of Indian cuisine, our Mix Vegetable Masala is the perfect choice. Come and indulge in the taste of India at our restaurant.', '2020-05-16 19:53:18', 'c4ca4238a0b923820dcc509a6f75849b', '2023-05-08 02:06:25', 'c4ca4238a0b923820dcc509a6f75849b', 1),
('feed2c53188bceeed1fabb2bb7f526712312', 'Mix BBQ platter promotion', 'Introducing our mouthwatering Mix BBQ Platter - a tantalizing assortment of grilled meats and vegetables that\'s perfect for meat lovers and barbecue enthusiasts.\r\n\r\nThis platter includes an array of grilled delights, such as succulent chicken tikka, juicy lamb chops, tender beef kebab, and grilled shrimp - all marinated in our signature blend of herbs and spices. The meats are grilled to perfection, locking in their natural flavors and juices.\r\n\r\nIn addition to the meats, our Mix BBQ Platter also includes a variety of grilled vegetables such as bell peppers, zucchini, and onions, providing a delicious and healthy complement to the meats.\r\n\r\nThis platter is perfect for sharing with friends and family, and is served with a side of tangy and spicy mint chutney, adding an extra layer of flavor to the dish.\r\n\r\nAt our restaurant, we use only the finest and freshest ingredients to create our Mix BBQ Platter, ensuring that each bite is a delightful explosion of flavors and textures.\r\n\r\nSo come and indulge in the rich and smoky flavors of our Mix BBQ Platter - a delicious and satisfying option for any occasion.', '2020-05-16 19:51:43', 'c4ca4238a0b923820dcc509a6f75849b', '2023-05-08 02:09:45', 'c4ca4238a0b923820dcc509a6f75849b', 1),
('feedaefa8a2a3cc2329eefffcc03fc69c1c1', 'Adding more and more in our dessert menu', 'Indulge in our delightful dessert selection that will satisfy any sweet tooth.\r\n\r\nFirst up, we have our classic Gulab Jamun - a sweet and syrupy dessert made from soft and spongy milk dumplings that are soaked in a light syrup flavored with rose water and cardamom. It\'s the perfect finish to any meal.\r\n\r\nNext, we have our signature Mango Kulfi - a refreshing and creamy dessert made from fresh mango pulp and condensed milk, frozen to perfection. The creamy texture and sweet, tropical flavor make this a favorite among our customers.\r\n\r\nFor chocolate lovers, we have our rich and decadent Chocolate Cake - a moist and fluffy cake that\'s layered with rich chocolate ganache and finished with a dusting of cocoa powder. It\'s the perfect dessert for any chocolate craving.\r\n\r\nLast but not least, we have our traditional Rice Kheer - a creamy and fragrant dessert made from slow-cooked rice, milk, and sugar, flavored with cardamom, saffron, and garnished with chopped nuts. It\'s a comforting and classic dessert that will leave you feeling satisfied and content.\r\n\r\nAt our restaurant, we take pride in using only the finest and freshest ingredients to create our desserts. Whether you\'re in the mood for something classic or something a little more unique, our dessert selection has something for everyone. Come and indulge in our sweet treats and end your meal on a high note.', '2020-05-16 19:51:15', 'c4ca4238a0b923820dcc509a6f75849b', '2023-05-08 02:10:32', 'c4ca4238a0b923820dcc509a6f75849b', 1),
('feedf4205ef9fded3031702a382e99c9102a', 'Tawa King', 'Get ready to indulge in the ultimate Desi Tawa Dish - a sizzling and aromatic platter of Indian curries and breads served on a large tawa plate.\r\n\r\nThis dish is a feast for the senses, starting with the sizzling hot plate that\'s filled with a variety of mouth-watering curries, each with its own distinct flavor and aroma. You\'ll find a mix of vegetarian and non-vegetarian curries such as butter chicken, paneer tikka masala, chana masala, and daal makhani, all expertly cooked with a blend of Indian spices and herbs.\r\n\r\nIn addition to the curries, the tawa plate is also piled high with an assortment of freshly baked Indian breads such as naan, roti, and kulcha, each with its own unique texture and flavor. These breads are perfect for dipping into the rich and flavorful curries, adding an extra layer of depth to the dish.\r\n\r\nAt our restaurant, we take pride in using only the freshest and highest quality ingredients to create our Desi Tawa Dish. Our chefs use their expert knowledge to create a harmonious balance of flavors and textures, ensuring that each bite is a delight for your taste buds.\r\n\r\nIf you\'re looking for a truly unique and satisfying dining experience, come and try our Desi Tawa Dish. It\'s perfect for sharing with friends and family, and is sure to leave you feeling satisfied and content.', '2020-05-16 19:52:23', 'c4ca4238a0b923820dcc509a6f75849b', '2023-05-08 02:08:57', 'c4ca4238a0b923820dcc509a6f75849b', 1);
